import React from "react";
import "./componentStyles/SelectSearch.css";

const SelectSearch = () => {
  return (
    <div className="selectSearch-container">
      <form className="form-container">
        <select className="filter1">Used Cars</select>
        <select className="filter2">Any Makes</select>
        <select className="filter2">Any Models</select>
        <select className="filter2">All Prices</select>
        <button type="submit">Search Icon</button>
      </form>
    </div>
  );
};

export default SelectSearch;
